const LastTutorial=()=>{


    const back  = (e) => {
        e.preventDefault();
        this.props.prevStep();
    }

    return(
        <div>
            Last Tutorial
            <button onClick={back}> Back </button>
        </div>
    );
}
export default LastTutorial;
